// src/components/About.jsx
import React from 'react';

const About = () => {
  return (
    <>
      <div>
        <img src="/assets/images/profile.jpg" alt="Foto Profil" className="w-64 h-40" />
      </div>

      <div>
        <text>Muhammad Vikhan Muharram</text>
      </div>
    </>
  );
};

export default About;
